import React from 'react';

function Footer() {
    return (
        <footer className="footer">
            <div className="Container">
                <div className="name-slogan">
                    <p>Mysore Motors</p>
                    <p>Power Drive</p>
                </div>
                <div className="details">
                    <a href="#">Nearby Store</a>
                    <a href="#">FeedBack</a>
                    <a href="#">Map</a>
                </div>
            </div>
        </footer>
    )
}
export default Footer;
